import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from '../../vuex/store'
import http from "./axios";
import api from "../../api/apiBase";
import cookie from "../../assets/js/common/cookie";
import base64 from "../../assets/js/common/base64";
import dataManage from "../../assets/js/common/dataManage";
import randomColor from "../../assets/js/common/randomColor";
// 解决ie白屏问题
import '@babel/polyfill'
import Es6Promise from 'es6-promise'
Es6Promise.polyfill()
import {Cascader} from "iview";
import {
    Group,
    Cell,
    XInput,
    XButton,
    Toast,
    XHeader,
    Search,
    Flexbox,
    FlexboxItem,
    Badge,
    Tabbar,
    TabbarItem ,
    VChart,
    VLine,
    VPoint,
    VScale,
    VTooltip,
    PopupHeader,
    Popup,
    Radio,
    PopupRadio,
    TransferDom,
    Grid,
    GridItem,
    Datetime,
    DatetimePlugin,
    Scroller,
    LoadMore,
    Loading,
    LoadingPlugin,
    Checklist,
    XTextarea,
    XDialog,
    Checker,
    CheckerItem,
    Dropdown,
    DropdownMenu,
    DropdownItem,
    XIcon,
    Confirm,
    Step,
    StepItem,
    Msg,
    Countdown,
    Icon,
    Box,
    Rater,
    Calendar,
    Alert,
} from 'vux'

/**
 * ivew 按需引入组件
 */
Vue.component('Cascader',Cascader);
/**
 * vux 按需引入组件
 */
Vue.component('group',Group);
Vue.component('cell',Cell);
Vue.component('x-input',XInput);
Vue.component('x-button',XButton);
Vue.component('toast',Toast);
Vue.component('x-header',XHeader);
Vue.component('search',Search);
Vue.component('flexbox',Flexbox);
Vue.component('flexbox-item',FlexboxItem);
Vue.component('badge',Badge);
Vue.component('tabbar',Tabbar);
Vue.component('tabbar-item',TabbarItem);
Vue.component('v-chart',VChart);
Vue.component('v-line',VLine);
Vue.component('v-point',VPoint);
Vue.component('v-scale',VScale);
Vue.component('v-tooltip',VTooltip);
Vue.component('popup-header', PopupHeader);
Vue.component('popup', Popup);
Vue.component('Radio', Radio);
Vue.component('popup-radio', PopupRadio);
Vue.component('grid', Grid);
Vue.component('grid-item', GridItem);
Vue.component('datetime', Datetime);
Vue.component('scroller', Scroller);
Vue.component('load-more', LoadMore);
Vue.component('loading', Loading);
Vue.component('checklist', Checklist);
Vue.component('x-textarea', XTextarea);
Vue.component('x-dialog', XDialog);
Vue.component('checker', Checker);
Vue.component('Dropdown', Dropdown);
Vue.component('DropdownMenu', DropdownMenu);
Vue.component('DropdownItem', DropdownItem);
Vue.component('checker-item', CheckerItem);
Vue.component('x-icon', XIcon);
Vue.component('confirm', Confirm);
Vue.component('step', Step);
Vue.component('step-item', StepItem);
Vue.component('msg', Msg);
Vue.component('countdown', Countdown);
Vue.component('icon', Icon);
Vue.component('box', Box);
Vue.component('rater', Rater);
Vue.component('calendar', Calendar);
Vue.component('alert', Alert);
Vue.directive('transfer-dom', TransferDom);
Vue.use(DatetimePlugin);
Vue.use(LoadingPlugin);


/**
 * 全局配置common方法
 */
Object.assign(Vue.prototype,{
    http,         //ajax封装的请求
    api,          //接口地址全局封装
    cookie,       //cookie存，删，
    base64,       //base64加密封装
    dataManage,   //数据管理
    randomColor,   //随机色
});

Vue.config.productionTip = false;

new Vue({
    router,
    store,
    render: h => h(App)
}).$mount('#mobile');
